import React from "react";

const Koompi = () => {
  return (
    <div className="section2Banner">
      <div className="ui container">
        <h1 className="section2Title">KOOMPI KOSMOS</h1>
        <p>
          KOSMOS is the default OS for KOOMPI Laptop and its future devices.
        </p>
        <a href="https://koompi.com/" target="_blank" rel="noopener noreferrer">
          <h5 className="learnMoreIndex">Learn More </h5>
        </a>
      </div>
    </div>
  );
};

export default Koompi;
